import React from 'react'

const Pagination = ({bikesPerPage, totalBikes}) => {

    const pageNumbers = [];

    for(let i=0; i <= Math.ceil(totalBikes / bikesPerPage); i++){
        pageNumbers.push(i);
    }

    return (
        <div>
            <nav className="pagination is-small" role="navigation" aria-label="pagination">
                <ul className="pagination-list">
                    {pageNumbers.map(number => (
                        <li key={number.id}><a href="!#" className="pagination-link"> {number} </a></li>
                    ))}
                </ul>
            </nav>
        </div>
    )
}

export default Pagination
